const container = require('markdown-it-container')
const anchor = require('markdown-it-anchor')
const uslug = require('uslug')

const createContainer = (name, defaultTitle = '') => {
  return [
    container,
    name,
    {
      render(tokens, idx) {
        const token = tokens[idx]
        const info = token.info
          .trim()
          .slice(name.length)
          .trim()
        if (name === 'example') {
          return `
<script>
  import examples from '@/examples/${info.split(' ')[0]}.ts'
  export default {
    data () {
      return {
        ...examples
      }
    }
  }
</script>\n
          `.trim()
        } else if (token.nesting === 1) {
          return `<div class="${name} custom-block"><p class="custom-block-title">${info ||
            defaultTitle}</p>\n`
        } else {
          return `</div>\n`
        }
      },
    },
  ]
}

module.exports = {
  parallel: false,
  publicPath:
    process.env.NODE_ENV === 'production' && process.env.VUE_APP_BUILD_MODE !== 'package'
      ? '/vue-slider-component/'
      : '/',
  outputDir: process.env.VUE_APP_BUILD_MODE === 'package' ? 'dist' : 'docs',
  chainWebpack: config => {
    if (process.env.VUE_APP_BUILD_MODE !== 'package') {
      config.resolve.alias.set('vue$', 'vue/dist/vue.common').set('~', __dirname)

      config.module
        .rule('vue')
        .test(/\.vue/)
        .use('vue-loader')
        .loader('vue-loader')
        .options({
          compilerOptions: {
            whitespace: 'preserve',
          },
        })
        .end()

      config.module
        .rule('md')
        .test(/\.md/)
        .use('vue-loader')
        .loader('vue-loader')
        .end()
        .use('vue-markdown-loader')
        .loader('vue-markdown-loader/lib/markdown-compiler')
        .options({
          raw: true,
          preventExtract: true,
          wrapper: 'article',
          use: [
            createContainer('tip', 'TIP'),
            createContainer('warning', 'WARNING'),
            createContainer('danger', 'WARNING'),
            createContainer('version'),
            createContainer('example'),
            [
              anchor,
              {
                level: 2,
                permalink: true,
                permalinkSymbol: '#',
                permalinkBefore: true,
                slugify: s => uslug(s),
              },
            ],
          ],
        })
    } else {
      config.output.libraryExport('default')
      config.externals({
        vue: {
          commonjs: 'vue',
          commonjs2: 'vue',
          root: 'Vue',
          amd: 'vue',
        },
      })
    }
  },
  css: { extract: !!process.env.NO_EXTRACT_CSS },
}
